import styled from "styled-components";

export const Navbar = styled.div`
  background-color: darkgrey;
  width: 100%;
  height: 50px;
  vertical-align: middle;
  overflow: visible;

  @media button {
    background-color: transparent;
    border-color: transparent;
    padding: 15px 0;
    margin-left: 10px;
  }
`;
